import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ProtectedRoute from "./components/ProtectedRoute";
// import AdminLayout from "./components/AdminLayout";

import AdminLogin from "./pages/admin/AdminLogin";
import Dashboard from "./pages/admin/Dashboard";
import Instructors from "./pages/admin/InstructorList";
import Courses from "./pages/admin/CourseList";
import AddCourse from "./pages/admin/AddCourse";
import AddInstructor from "./pages/admin/AddInstructor";
import AddLecture from "./pages/admin/AddLecture";

function App() {
  return (
    <Router>
      <Routes>
        {/* Public Route */}
        <Route path="/admin/login" element={<AdminLogin />} />

        {/* Protected Admin Routes with single Navbar */}
        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute>
              {/* <AdminLayout> */}
              <Dashboard />
              {/* </AdminLayout> */}
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/instructors"
          element={
            <ProtectedRoute>
              {/* <AdminLayout> */}
              <Instructors />
              {/* </AdminLayout> */}
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/courses"
          element={
            <ProtectedRoute>
              <AdminLayout>
                <Courses />
              </AdminLayout>
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-course"
          element={
            <ProtectedRoute>
              <AdminLayout>
                <AddCourse />
              </AdminLayout>
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-instructor"
          element={
            <ProtectedRoute>
              <AdminLayout>
                <AddInstructor />
              </AdminLayout>
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-lecture"
          element={
            <ProtectedRoute>
              <AdminLayout>
                <AddLecture />
              </AdminLayout>
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
